        <div>
            <Row>
            <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d5162.696271805735!2d90.39384562253873!3d23.79805345651374!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3755c7bfd2baa91f%3A0xd5898747410ba3e1!2sLaksura%20Enterprise!5e0!3m2!1sen!2sus!4v1630130793367!5m2!1sen!2sus" style={{ height:500}}></iframe>
            </Row>
           
        </div>
    )
}

export default LaksuraMall
